pragma solidity ^0.5.0;

import "zos-lib/contracts/Initializable.sol";

contract DemoContract is Initializable {

    function init() public initializer {
    }

    event DemoEvent(
        int256 a,
        uint256 b,
        bool c,
        address d,
        string e,
        bytes8 f
    );

    event DemoEvent22(
        int256 a,
        uint256 b,
        bool c,
        address d,
        string e,
        bytes8 f
    );

    function demoFunction(int256 a, uint256 b, bool c, address d, string memory e, bytes8 f) public {
        emit DemoEvent(a, b, c, d, e, f);
        emit DemoEvent22(a, b, c, d, e, f);
        emit DemoEvent(a, b, c, d, e, f);
    }
}
